import { Container, Row } from "react-bootstrap";

const BookComplete = ({ bookcomplete }) => {
  return (
    <>
      <Container>
        <Row>
          <div className="book-complete-box"></div>
        </Row>
      </Container>
    </>
  );
};

export default BookComplete;
